import logo from'./logo.svg';
import './App.css';
import First from'./Components/first/first';
import Second from'./Components/second/second';
import Third from'./Components/third/third';
import four from'./Components/four/four';
import Five from'./Components/five/five';
import Sixth from'./Components/Sixth/six';
import six from'./Components/Sixth/Sixth';
import Seven from'./Components/seven/seven';
import Eight from'./Components/eight/eight';
import { BrowserRouter, Routee, Routes } from 'react-router-dom';
import Menu from './components/menu/menu';
import { fireEvent } from '@testing-library/dom';

function App() {
  return (
    <div className="App">

        <p>
          Welcome to react programmimng
        </p>
          <BrowserRouter>
          <Routes>
            <Route path="/" element={<Menu />} />
          <Route path="/menu" element={<Menu />} />
          <Route path='/first' element={<First />} />
          <Route path='/second' element={<Second />} />
          <Route path='/third' element={<Third firstName="Prasanna" lastName="Pappu" company="Wipro" />} />
          <Route path='/four' element={<Four />} />
          <Route path='/five' element={<Five />} />
          <Route path='/Sixth' element={<Sixth />} />
          <Route path='/seven' element={<Seven />} />
          <Route path='/eight' element={<Eight />} />
          <Route path='/ButtonExx' element={<ButtonEx />} />

          </Routes>
          </BrowserRouter>
    </div>
  );
}

export default App;
